import{a as m}from"./chunk-BVWRDFU3.js";import"./chunk-DFFVOSJF.js";import{Fb as t,Ja as r,Ua as s,lb as y,mb as i,nb as e,ob as n}from"./chunk-BP7CLSB6.js";var u=class o{faqItems=[{title:"Jak d\u0142ugo si\u0119 utrzymuje?",answer:"W zale\u017Cno\u015Bci od typu i kolorytu sk\xF3ry 2-5 lat. Gdy makija\u017C traci nasycenie, mo\u017Ce zosta\u0107 w ka\u017Cdym czasie od\u015Bwie\u017Cony. Zalet\u0105 starego ju\u017C jasnego makija\u017Cu jest mo\u017Cliwo\u015B\u0107 dobrania jego zupe\u0142nie nowego wizerunku."},{title:"Jakie niesie ze sob\u0105 ryzyko?",answer:"U\u017Cywane przez nas pigmenty i potrzebne akcesoria posiadaj\u0105 dermatologiczne certyfikaty jako\u015Bci z pozytywnym wynikiem, co oznacza, \u017Ce u\u017Cywane s\u0105 zgodnie z przepisami prawnymi i wymaganiami higieny. Nasze medyczne barwniki <b>zdoby\u0142y z\u0142oty medal</b> na mi\u0119dzynarodowych targach za najwy\u017Csz\u0105 jako\u015B\u0107 i bezpiecze\u0144stwo."},{title:"Makija\u017C permanentny jest rozwi\u0105zaniem:",answer:"\u2013 dla wszystkich, kt\xF3rzy najch\u0119tniej wcale si\u0119 nie maluj\u0105 (r\xF3wnie\u017C sportowc\xF3w i ludzi odwiedzaj\u0105cych saun\u0119), a mimo to chcieliby wygl\u0105da\u0107 pi\u0119kniej i bardziej \u015Bwie\u017Co<br/>\u2013 dla kobiet, kt\xF3re maj\u0105 ma\u0142o czasu na makija\u017C<br/>\u2013 dla kobiet nosz\u0105cych okulary i szk\u0142a kontaktowe, kt\xF3re poprzez fakt, \u017Ce s\u0142abo widz\u0105, maj\u0105 problemy z wykonaniem makija\u017Cu<br/>\u2013 dla wszystkich kobiet i m\u0119\u017Cczyzn z rzadkimi brwiami, ma\u0142ymi oczami, z bladymi ustami, lub ustami o nieregularnym kszta\u0142cie, z rzadkimi rz\u0119sami<br/>\u2013 dla wszystkich kt\xF3rzy chcieliby dokona\u0107 trwa\u0142ej korekty swojej naturalnej urody"},{title:"Piel\u0119gnacja cery sk\u0142onnej do przebarwie\u0144 z hiperpigmentacj\u0105",answer:"Podczas rozmowy ustalamy kszta\u0142t i kolor optymalny do typu Twojej urody. Makija\u017C permanentny powinien by\u0107 bardzo naturalny i tylko podkre\u015Bla\u0107 Twoj\u0105 naturaln\u0105 urod\u0119. Najpierw nanosimy na sk\xF3r\u0119 znieczulaj\u0105cy fluid, ostro\u017Cnie pigmentujemy i delikatnie cieniujemy kontury aby by\u0142y one czyste i bez zarzut\xF3w. Kontury i cienie s\u0105 w\xF3wczas bardzo delikatne i jasne. Nast\u0119pnie na brwiach malujemy w\u0142oski, rz\u0119sy kolorujemy tu\u017C u nasady, a kontur ust lekko lub ca\u0142kowicie cieniujemy. Zawsze podczas naszej pracy zwracamy uwag\u0119 na to, aby makija\u017C by\u0142 jak najbardziej naturalny, tzn. zawsze pracujemy na r\xF3\u017Cnych, indywidualne dobranych pigmentach, aby podkre\u015Bli\u0107 naturalno\u015B\u0107. Oczy maj\u0105 wi\u0119cej wyrazu i wygl\u0105daj\u0105 m\u0142odziej, usta s\u0105 pe\u0142niejsze, a mimo to naturalne, a brwi, dzi\u0119ki temu, \u017Ce narysowali\u015Bmy na nich w\u0142oski lub cie\u0144 po kt\xF3rych w rezultacie pozostaje tylko delikatna linia, s\u0105 r\xF3wnomierne i g\u0119ste."},{title:"Jak d\u0142ugo si\u0119 goi?",answer:"Jedyna niedogodno\u015B\u0107 po wykonanym makija\u017Cu to z\u0142uszczenie si\u0119 nask\xF3rka na 3-4 dzie\u0144 po zabiegu. Na przyspieszone gojenie ma wp\u0142yw odpowiednia piel\u0119gnacja i nat\u0142uszczanie."},{title:"Technika pigmentu",answer:"Pracujemy opieraj\u0105c si\u0119 na wysokiej technice i innowacyjnych metodach PUREBEAU. Pracujemy wy\u0142\u0105cznie w obr\u0119bie nask\xF3rka, w kt\xF3rym nie wyst\u0119puj\u0105 naczynia krwiono\u015Bne jak i receptory odczuwania b\xF3lu. Pracujemy naturalnie i chcemy tylko istniej\u0105ce pi\u0119kno poprzez nasz\u0105 prac\u0119 podkre\u015Bli\u0107, wykorzystuj\u0105c wiedz\u0119 z zakresu wiza\u017Cu twarzy.<br/><br/>Z nasz\u0105 delikatn\u0105 i zrozumia\u0142\u0105 technik\u0105 wykonujemy nast\u0119puj\u0105ce zabiegi:<br/><br/><b>Tworzenie brwi:</b><br/>- system wype\u0142niania w\u0142osem (metod\u0105 pi\xF3rkow\u0105)<br/>- system powierzchniowego lekkiego cienia<br/><br/><b>Kreska na powiece:</b><br/>- g\xF3rna i dolna powieka<br/><br/><b>Kontur ust:</b><br/>- przyciemnienie ust<br/>- korekta ust<br/>- wype\u0142nienie ust pigmentem"}];static \u0275fac=function(a){return new(a||o)};static \u0275cmp=s({type:o,selectors:[["app-permanent-makeup"]],decls:11,vars:1,consts:[[1,"sale-page"],[1,"sale-header"],[1,"divider"],[1,"sale-content"],[1,"sale-text"],["src","assets/oferta-podstrony/permanentny.jpg","alt","Makija\u017C permanentny",1,"sale-img"],[1,"w-100",3,"items"]],template:function(a,c){a&1&&(i(0,"section",0)(1,"header",1)(2,"h1"),t(3,"Makija\u017C permanentny"),e(),n(4,"div",2),e(),i(5,"div",3)(6,"div",4)(7,"p"),t(8," Makija\u017C permanentny podkre\u015Bla Twoj\u0105 urod\u0119 w spos\xF3b naturalny, indywidualny i na d\u0142ugi czas. Dzi\u0119ki metodzie PUREBEAU mo\u017Cna uwydatni\u0107, nanie\u015B\u0107 lub skorygowa\u0107 brwi, usta lub kreski na powiekach. Makija\u017C permanentny jest rozwi\u0105zaniem dla wszystkich, kt\xF3rzy kochaj\u0105 perfekcyjno\u015B\u0107, komfort, wygod\u0119 i nienaganny wygl\u0105d w ka\u017Cdej sytuacji. "),e()()(),n(9,"img",5)(10,"app-faq",6),e()),a&2&&(r(10),y("items",c.faqItems))},dependencies:[m],encapsulation:2})};export{u as PermanentMakeup};
